from web3 import Web3, HTTPProvider
import json

# 连接到 Ethereum 节点
w3 = Web3(HTTPProvider('http://localhost:7545'))

# 读取智能合约的 ABI 和字节码
with open('/Users/panzhuochen/repository/offChainStorage/protocol/PoS/build/Verifier.abi', 'r') as abi_definition:
    abi = json.load(abi_definition)
with open('/Users/panzhuochen/repository/offChainStorage/protocol/PoS/build/Verifier.bin', 'r') as bytecode_file:
    bytecode = bytecode_file.read()

# 准备合约构造函数的参数（如果有）
constructor_args = ()  # 填入构造函数参数，如果没有则为空

# 创建合约对象
contract = w3.eth.contract(abi=abi, bytecode=bytecode)

address = '0x904735ED9F055aac43f323fe24a55784B307F33F'
# 获取部署账户的nonce
nonce = w3.eth.get_transaction_count(address)

block_gas_limit = w3.eth.get_block('latest')['gasLimit']
print(f"Block gas limit: {block_gas_limit}")


# 构建合约部署事务
transaction = contract.constructor(*constructor_args).build_transaction({
    'from': address,
    'gas': 6721974,  # 你可以调整这个数值
    'gasPrice': w3.to_wei('20', 'gwei'),
    'nonce': nonce,
})

# 签署事务
private_key = '5231159b2ebbe3efefa578da77132ec9663ff004f4fe34740d05e9f50eaf8121'
# signed_transaction = w3.eth.account.sign_transaction(transaction, private_key)
#
# # 发送部署事务
# transaction_hash = w3.eth.send_raw_transaction(signed_transaction.rawTransaction)
#
# # 等待事务被挖矿
# transaction_receipt = w3.eth.wait_for_transaction_receipt(transaction_hash)
