# print(f"合约已部署到地址：{contract_address}")

contract_address = '0xE96dbe9B5280d9d758CD1BFca032B0FFA1FB41D2'
contract_instance = w3.eth.contract(address=contract_address, abi=abi)

# 准备函数参数
_pk = bytes.fromhex('01')
_index = 1
_beta = 30
_root = bytes.fromhex('b5a19ebe2a85b54ae5e0b9d045b7e9062af6ebae64c0138e7ecd157097d5fc34')
_availableSpace = 3222232
_pricePerGBPerMonth = 2333333

transaction = contract_instance.functions.setProof(_pk, _index, _beta, _root, _availableSpace, _pricePerGBPerMonth).build_transaction({
    'from': address,
    'gas': 6721974,  # 这是一个估计值，你可以使用 `estimateGas` 函数来获取更准确的数值
    'gasPrice': w3.to_wei('20', 'gwei'),
    'nonce': w3.eth.get_transaction_count(address),
})
signed_transaction = w3.eth.account.sign_transaction(transaction, private_key)

transaction_hash = w3.eth.send_raw_transaction(signed_transaction.rawTransaction)
transaction_receipt = w3.eth.wait_for_transaction_receipt(transaction_hash)

print("Transaction receipt: {}".format(transaction_receipt))

